    async function getStockRankList() {
        const list = await StockAction.getStockRankList()
        await console.log(list)
        await setRankList(list)
    }

    return(
        <>
            <h2>외국인 매수 상</h2>
            <Grid container rowSpacing={1} columnSpacing={{ xs: 1 }}>
                { rankList.themeStockList && stockList.themeStockList.map((list, index) =>
                    <Grid item xs={6} key={list.themeStockUid}>
                        <CardComponent title={list.theme} content={list.themeInfo} />
